Alfie (Anthony Hopkins) heeft zijn vrouw verlaten en probeert met fitness en viagra weer te leven als een jonge god; dat drijft hem in de armen van een prostituee waar hij mee trouwt. Zijn vrouw zoekt haar heil bij een waarzegster; hun dochter Sally (Naomi Watts) werkt voor een galeriehouder genaamd Greg (Antonio Banderas) en is getrouwd met Roy (Josh Brolin), een mislukt schrijver die voornamelijk naar de buurvrouw aan de overkant loert.

